// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract DecentralizedStoragePlatform {
    // Storage offering made by a provider
    struct StorageOffering {
        address payable provider;
        uint256 capacity; // in GB
        uint256 pricePerGBPerDay; // in wei
        bool isAvailable;
    }

    // Agreement between a consumer and a provider
    struct StorageAgreement {
        uint256 agreementId;
        address payable consumer;
        address payable provider;
        uint256 capacity; // in GB
        uint256 pricePerGBPerDay; // in wei
        uint256 totalPrice; // in wei
        uint256 startTime; // timestamp
        uint256 endTime; // timestamp
        bool isActive;
        bool isPaid;
    }

    // Counters
    uint256 public agreementCounter;

    // Mappings
    mapping(address => StorageOffering) public offerings;
    mapping(uint256 => StorageAgreement) public agreements;

    // Events
    event OfferingCreated(address indexed provider, uint256 capacity, uint256 pricePerGBPerDay);
    event OfferingUpdated(address indexed provider, uint256 capacity, uint256 pricePerGBPerDay);
    event OfferingRemoved(address indexed provider);
    event AgreementCreated(
        uint256 indexed agreementId,
        address indexed consumer,
        address indexed provider,
        uint256 capacity,
        uint256 totalPrice,
        uint256 startTime,
        uint256 endTime
    );
    event PaymentMade(uint256 indexed agreementId, uint256 amount);
    event AgreementCompleted(uint256 indexed agreementId);
    event AgreementCancelled(uint256 indexed agreementId);

    // Providers create or update their storage offering
    function createOrUpdateOffering(uint256 _capacity, uint256 _pricePerGBPerDay) external {
        require(_capacity > 0, "Capacity must be greater than zero");
        require(_pricePerGBPerDay > 0, "Price must be greater than zero");

        offerings[msg.sender] = StorageOffering({
            provider: payable(msg.sender),
            capacity: _capacity,
            pricePerGBPerDay: _pricePerGBPerDay,
            isAvailable: true
        });

        emit OfferingCreated(msg.sender, _capacity, _pricePerGBPerDay);
    }

    // Providers can remove their offering
    function removeOffering() external {
        StorageOffering storage offering = offerings[msg.sender];
        require(offering.isAvailable, "No offering to remove");

        delete offerings[msg.sender];

        emit OfferingRemoved(msg.sender);
    }

    // Consumers create an agreement with a provider
    function createAgreement(address payable _provider, uint256 _capacity, uint256 _durationInDays) external payable {
        StorageOffering storage offering = offerings[_provider];
        require(offering.isAvailable, "Offering not available");
        require(_capacity > 0 && _capacity <= offering.capacity, "Invalid capacity requested");
        require(_durationInDays > 0, "Duration must be greater than zero");

        uint256 totalPrice = _capacity * offering.pricePerGBPerDay * _durationInDays;
        require(msg.value == totalPrice, "Incorrect payment amount");

        agreementCounter++;
        uint256 startTime = block.timestamp;
        uint256 endTime = startTime + (_durationInDays * 1 days);

        agreements[agreementCounter] = StorageAgreement({
            agreementId: agreementCounter,
            consumer: payable(msg.sender),
            provider: _provider,
            capacity: _capacity,
            pricePerGBPerDay: offering.pricePerGBPerDay,
            totalPrice: totalPrice,
            startTime: startTime,
            endTime: endTime,
            isActive: true,
            isPaid: true
        });

        emit AgreementCreated(
            agreementCounter,
            msg.sender,
            _provider,
            _capacity,
            totalPrice,
            startTime,
            endTime
        );
        emit PaymentMade(agreementCounter, totalPrice);
    }

    // Providers confirm completion of the agreement
    function completeAgreement(uint256 _agreementId) external {
        StorageAgreement storage agreement = agreements[_agreementId];
        require(agreement.isActive, "Agreement is not active");
        require(msg.sender == agreement.provider, "Only provider can complete the agreement");
        require(block.timestamp >= agreement.endTime, "Agreement duration not yet ended");

        agreement.isActive = false;

        // Transfer payment to the provider
        agreement.provider.transfer(agreement.totalPrice);

        emit AgreementCompleted(_agreementId);
    }

    // Consumers can cancel the agreement before it starts
    function cancelAgreement(uint256 _agreementId) external {
        StorageAgreement storage agreement = agreements[_agreementId];
        require(agreement.isActive, "Agreement is not active");
        require(msg.sender == agreement.consumer, "Only consumer can cancel the agreement");
        require(block.timestamp < agreement.startTime, "Agreement has already started");

        agreement.isActive = false;

        // Refund the consumer
        agreement.consumer.transfer(agreement.totalPrice);

        emit AgreementCancelled(_agreementId);
    }

    // Fallback and receive functions to handle plain Ether transfers
    fallback() external payable {
        revert("Invalid transaction");
    }

    receive() external payable {
        revert("Cannot accept Ether directly");
    }
}
